package com.ForNested;

public class For_Nested_Loop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("Start");
		for (int i = 1; i <= 3; i++) {
			for (int j = 1; j <= 3; j++) {
			System.out.print(j + " " );	
			}
	System.out.println();
	}
		System.out.println();
		System.out.println("End");

}
}